"""
Эталонный звук открытия банки пива.
ЭТОТ ФАЙЛ СГЕНЕРИРОВАН АВТОМАТИЧЕСКИ - НЕ РЕДАКТИРОВАТЬ!
"""

import numpy as np
import base64
import zlib

# Параметры эталона
TEMPLATE_SAMPLE_RATE = 44100
TEMPLATE_LENGTH = 8820

# Закодированный эталонный звук (сжатый base64)
_TEMPLATE_DATA = """

"""

def get_template() -> np.ndarray:
    """Получить эталонный звук открытия банки"""
    compressed = base64.b64decode(_TEMPLATE_DATA.strip())
    audio_bytes = zlib.decompress(compressed)
    return np.frombuffer(audio_bytes, dtype=np.float32)


# Кэшированный эталон
_cached_template = None

def get_cached_template() -> np.ndarray:
    """Получить кэшированный эталон"""
    global _cached_template
    if _cached_template is None:
        _cached_template = get_template()
    return _cached_template




# Эталон #2: открытие издалека
_TEMPLATE_DATA_FAR = """

"""

def get_template_far() -> np.ndarray:
    """Получить эталон открытия издалека"""
    compressed = base64.b64decode(_TEMPLATE_DATA_FAR.strip())
    audio_bytes = zlib.decompress(compressed)
    return np.frombuffer(audio_bytes, dtype=np.float32)

_cached_template_far = None

def get_cached_template_far() -> np.ndarray:
    """Получить кэшированный эталон (издалека)"""
    global _cached_template_far
    if _cached_template_far is None:
        _cached_template_far = get_template_far()
    return _cached_template_far
